insert into ricetta (id, cuoco_id, nome, descrizione, steps) values(nextval('ricetta_seq'), 1,'Amatriciana', 'Un classico della cucina italiana, originario della citta di Amatrice nel Lazio. Famosa per la sua semplicita e il suo gusto deciso, caratterizzato dall uso di ingredienti tradizionali che si fondono armoniosamente per creare un esperienza culinaria autentica e saporita.', ARRAY['Taglia il guanciale a striscioline.','Rosolalo in una padella fino a quando diventa croccante e dorato, rilasciando tutto il suo grasso saporito.','Togli il guanciale dalla padella, lasciando il grasso all interno.','Nel grasso si fa soffriggere il peperoncino e successivamente si aggiunge la salsa di pomodoro e si lascia cuocere fino ad ottenere un sugo denso e saporito.','Cuoci la pasta (solitamente spaghetti o bucatini) al dente e poi saltala nella padella col sugo.','Aggiungi il guanciale croccante e amalgama il tutto.','Servi il piatto con una generosa spolverata di pecorino romano grattugiato.']);
insert into ricetta (id, cuoco_id, nome, descrizione, steps) values(nextval('ricetta_seq'), 101, 'Involtini di zucchine' , 'Un piatto molto versatile che puo fungere da secondo piatto veloce ma anche da contorno o antipasto, perfetto anche per arricchire un menu estivo veloce. Inoltre le zucchine sono verdure di stagione, leggere e saporite per questo motivo sono spesso presenti nella maggior parte delle tipiche ricette estive di piatti freddi in prevalenza.', ARRAY['Lava e taglia le zucchine a fette sottili nel senso della lunghezza.','Griglia le fette di zucchine su una piastra calda fino a che diventano tenere e leggermente dorate.','Prepara il ripieno mescolando la ricotta con il parmigiano grattugiato, il sale, il pepe e un po di basilico tritato.','Metti un cucchiaino di ripieno su ogni fetta di zucchina grigliata.','Arrotola delicatamente le fette di zucchina intorno al ripieno per formare degli involtini.','Sistema gli involtini in una teglia leggermente oliata.','Inforna a 180 gradi per circa 15 minuti, fino a che il ripieno sia caldo e leggermente dorato.','Servi gli involtini freddi, guarniti con qualche foglia di basilico fresco.']);
insert into ricetta (id, cuoco_id, nome, descrizione, steps) values(nextval('ricetta_seq'), 51,'CheeseCake', 'Un perfetto dessert da servire agli amici a cena o da condividere in famiglia, magari in occasione di un compleanno. Una base friabile di biscotti per una fresca cheesecake con Philadelphia, arricchita di panna, yogurt e una irresistibile copertura alle fragole.', ARRAY['Trita i biscotti e mescolali con il burro fuso','Premi il composto di biscotti sul fondo di una teglia a cerniera e lascia rassodare in frigo','Mescola il formaggio Philadelphia con lo zucchero fino ad ottenere un composto cremoso. Incorpora lo yogurt e la vaniglia, mescolando fino ad ottenere un composto omogeneo','Versa il composto di formaggio sopra la base di biscotti raffreddata','Una volta raffreddata, copri e metti in frigorifero per almeno 4 ore o durante la notte','Per la copertura, frulla le fragole e versa la salsa sulla cheesecake raffreddata prima di servire','Decora con fragole fresche se desideri']);
